import React, {Fragment, useState} from 'react';

const Listadodenombres = () => {
    return(
        <div>
            <h1>Aplicación CRUD Básica</h1>
            <div className="row">
                <div className="col">Listado de Nombres</div>
                <div className="col">Formulario para añadir nombres</div>
            </div>
        </div>
    )
}

export default Listadodenombres;
